import React, { useState } from "react";
import { Row, Col } from "react-bootstrap";
import Navigation from "../Component/Navigation";
import "./Style.css"
import Main from "./Main";

const Login = () =>{

    const [count , setCount] = useState(false);
    return(
        <>
        <div>
            <Row><Navigation/></Row>
              {/* Ternary Operator */}
              {
                  !count ? 
                  <Row>
                  <Col></Col>
                  {/* Login Page */}
                  <Col> 
                   <h1 className="mt-5 mb-3 ml-5 ">Login Page</h1>
                   <input type="email" placeholder="Username" className="email mt-2 mb-3 ml-4 mr-4" />
                   <input type="password" placeholder="Password" className="email mb-3 ml-4 mr-4" />
                   <button onClick={() => {setCount(true)}} className="btn btn-dark center pr-5">Subbmit</button>
                   <button onClick={() => {}} className="btn btn-dark center ml-5">Subbmit</button>
                  </Col>
                  <Col></Col>
              </Row>
              : <Main/>
              }

           

       
        </div>
        </>
    )
};

export default Login
